import Layout from '../src/components/Layout';
import { Cookies } from 'react-cookie';
import Router from 'next/router'

//components
import Nav from '../src/components/dashboard/Nav';
import Jumbo from "../src/components/dashboard/Jumbo";
import Footer from '../src/components/dashboard/Footer';
import Card from '../src/components/dashboard/Card';

const cookies = new Cookies();

const home = () => {
    let activo = cookies.get('activo')
    if (!activo) {
        return (
            <>
                <h1>Usuario Inactivo, vaya al login.</h1>
                <button type='button' onClick={() => {
                    Router.push('/')
                }}>
                    Login
                </button>
            </>
        );
    }
    return (
        <Layout>
            <div className='main'>
                <Nav />
                <Jumbo />
                <div className='cards'>
                    <div className='card'>
                        <Card
                            ruta='data:image/jpeg;base64,'
                            text='Dashboard'
                        />
                    </div>
                    <div className='card'>
                        <Card
                            ruta='data:image/jpeg;base64,'
                            text='Profesores'
                            link = '/profesores'
                        />
                    </div>
                    <div className='card'>
                        <Card
                            ruta='https://img2.freepng.es/20180425/kdw/kisspng-student-group-student-society-5ae0b7c760ae38.822007341524676551396.jpg'
                            text='Estudiantes'
                        />
                    </div>
                    <div className='card'>
                        <Card
                            ruta='https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQ_XFXetk5uPqg2wqiASTHSowmk3KeVSIcHg-O1kcCA7vTKMW5l&usqp=CAU'
                            text='Cursos'
                        />
                    </div>
                </div>
                <Footer />
            </div>
            <style global jsx>{`
                    html,
                    body,
                    body > div:first-child,
                    div#__next,
                    div#__next > div,
                    div#__next > div > div {
                        height: 100%;
                    }

                    *{
                        box-sizing: border-box;
                    }

                    .main{
                        width: 100%;
                        height: 100%;
                        background: linear-gradient(180deg, #C2C0C0, white);
                    }   

                    .cards{
                        width: 100%;
                        height: 30%;
                        justify-content: center;
                        align-items: center;
                        display: flex;
                        flex-wrap: wrap;
                    }      

                    .cards .card{
                        width: 23%;
                        height: 90%;
                        border: 1px solid;
                        margin: 10px;
                        justify-content: center;
                        align-items: center;
                        display: flex;
                    }

                    @media (max-width: 1920px){
                        .cards{
                            height: 30%;
                        }

                        .cards .card{
                            width: 23%;
                            height: 83%;
                        }
                    }

                    @media (max-width: 1400px){
                        .cards{
                            height: 40%;
                        }

                        .cards .card{
                            width: 23%;
                            height: 63%;
                        }
                    }

                    @media (max-width: 1280px){
                        .cards{
                            height: 50%;
                            margin-bottom: 200px;
                        }

                        .cards .card{
                            width: 30%;
                            height: 43%;
                        }
                    }

                    @media (max-width: 1024px){
                        .cards{
                            height: 60%;
                            margin-bottom: 650px;
                        }

                        .cards .card{
                            width: 45%;
                            height: 43%;
                        }
                    }

                    @media (max-width: 600px){
                        .cards{
                            height: 100%;
                            margin-bottom: 950px;
                        }

                        .cards .card{
                            width: 80%;
                            height: 23%;
                        }
                    }

                    @media (max-width: 400px){
                        .cards{
                            height: 150%;
                            margin-bottom: 1100px;
                        }

                        .cards .card{
                            width: 95%;
                            height: 23%;
                        }
                    }
                `}</style>
        </Layout>
    );
}


export default home;
